import NavLinks from "./NavLinks.js";
import "./navbar.css";
import { TiThMenuOutline } from "react-icons/ti";

const MobileNavigation = () => {
  return (
    <>
      <div></div>
      <nav className="MobileNavigation">
        <NavLinks />
        <TiThMenuOutline />
      </nav>
    </>
  );
};

export default MobileNavigation;
